DROP TABLE IF EXISTS `bare_metal_rule`;
CREATE TABLE `bare_metal_rule` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL,
  `name` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `start_ip` varchar(64) COLLATE utf8_bin DEFAULT NULL,
